import React from 'react';
import { View,Text, TextInput, Button } from 'react-native';
import Logo from "../../assets/images/logo.jpg";

function SignIn(props) {
    return (
        <div>
            <View>

                <Text><img scr={Logo} />Signup</Text>
            </View>
            
            
        </div>
    );
}

export default SignIn;
